import base64

def save_pdf_from_base64(base64_string, output_file_path):
    # Декодируем Base64 в бинарные данные
    pdf_data = base64.b64decode(base64_string)

    # Записываем данные в PDF файл
    with open(output_file_path, 'wb') as pdf_file:
        pdf_file.write(pdf_data)

    print(f"PDF сохранен как {output_file_path}")

# Пример использования
base64_pdf_string = ""
save_pdf_from_base64(base64_pdf_string, 'output.pdf')
